(1, NULL, NULL, NULL, NULL, NULL, 1, '2018-03-28 09:09:38', 1, 'Lê Thái', '2018-03-28 09:10:43', 1, 'Lê Thái', NULL, NULL, 'Lê Thái', 'GREY', NULL, 'BUGS', NULL, NULL, NULL, NULL, 'blank', 'a:0:{}', 'a:4:{s:9:\"utmSource\";N;s:9:\"utmMedium\";N;s:11:\"utmCampaign\";N;s:10:\"utmContent\";N;}', NULL, '<!DOCTYPE html><html xmlns=\"http://www.w3.org/1999/xhtml\" style=\"\" class=\" js flexbox flexboxlegacy canvas canvastext webgl no-touch geolocation postmessage websqldatabase indexeddb hashchange history draganddrop websockets rgba hsla multiplebgs backgroundsize borderimage borderradius boxshadow textshadow opacity cssanimations csscolumns cssgradients cssreflections csstransforms csstransforms3d csstransitions fontface no-generatedcontent video audio localstorage sessionstorage webworkers applicationcache svg inlinesvg smil svgclippaths js csstransforms csstransforms3d csstransitions responsejs \"><head>\n        <title>{subject}</title>\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n        <style type=\"text/css\" media=\"only screen and (max-width: 480px)\">\n            /* Mobile styles */\n            @media only screen and (max-width: 480px) {\n                [class=\"w320\"] {\n                    width: 320px !important;\n                }\n                [class=\"mobile-block\"] {\n                    width: 100% !important;\n                    display: block !important;\n                }\n            }\n        </style>\n                                      </head>\n    <body style=\"margin:0\" class=\"ui-sortable\">\n        <div data-section-wrapper=\"1\">\n            <center>\n                <table data-section=\"1\" style=\"width: 600;\" width=\"600\" cellpadding=\"0\" cellspacing=\"0\">\n                    <tbody>\n                        <tr>\n                            <td>\n                                <div data-slot-container=\"1\" style=\"min-height: 30px\" class=\"ui-sortable\">\n                                    <div data-slot=\"text\">                                                                                                 <br />Dear ,<br />Mình là Trang - Chuyên viên Nhân sự phụ trách mảng Tuyển dụng của công ty Cổ Phần Dịch Vụ Truyền thông Đa Phương Tiện Việt Nam (VMMS). Như đã giới thiệu ở thư trước, công ty mình hoạt động trong lĩnh vực phần mềm chuyên cung cấp các giải pháp cho hệ thống website thương mại điện tử.<br />Hiện nay, công ty VMMS đang không ngừng mở rộng quy mô và thị trường với nhiều khách hàng đến từ Mỹ, Úc ,Pháp, Singapore...Vì vậy, VMMS đang có đợt tuyển dụng mới với 5 vị trí Chuyên viên Nhận dự án Website trong nước và nước ngoài (VMMS tuyển cả vị trí thực tập, nếu bạn chưa có kinh nghiệm sẽ được đào tạo thêm!)<br />Trường Đại học Hà Nội (HANU) được biết đến là một trong những trường có chương trình đạo tạo CNTT bậc đại học bằng tiếng Anh tốt nhất Hà Nội. Với kiến thức về CNTT cũng như nền tảng Tiếng Anh tốt, sinh viên HANU rất thích hợp với vị trí nhân viên Nhận dự án Website trong nước và nước ngoài – người hỗ trợ, làm cầu nối giữa khách hàng với doanh nghiệp – đây là vị mà VMMS đang rất cần và mong muốn có thể được hợp tác với các bạn sinh viên năng động của trường Đại học Hà Nội.<br />MÔ TẢ CÔNG VIỆC:<br /><ul type=\"disc\"><li>Nghiên cứu phân tích các yêu cầu dự án và gửi cho Bộ phận Lập trình để xúc tiến dự án.</li><li>Lập bảng báo giá cho khách hàng.</li><li>Trao đổi, tư vấn, chăm sóc các khách hàng trong việc thiết kế, xây dựng website (sẽ được trợ giúp và hướng dẫn thêm trong quá trình làm việc).</li><li>Làm việc, phối hợp công việc theo nhóm dưới sự phân công của quản lý dự án.</li></ul>QUYỀN LỢI ĐƯỢC HƯỞNG:<br /><ul type=\"disc\"><li>Công việc năng động, sáng tạo với các dự án hiện đại, đa dạng của nước ngoài, thường xuyên có cơ hội gặp gỡ và làm việc với các khách hàng trong và ngoài nước.</li><li>Môi trường làm việc thân thiện, thoải mái.</li><li>Được học tập, phát triển nâng cao trình độ ngoại ngữ (tiếng Anh) và kỹ năng chuyên môn, có nhiều cơ hội thăng tiến trong công việc (có cơ hội trở thành nhân viên chính thức đối với vị trí thực tập).</li><li>Lương cơ bản + thưởng dự án (tổng thu nhập từ 4 - 7 triệu với Junior Position, từ 7 - 25 triệu với Senior Position)</li><li>Có trợ cấp đối với vị trí Thực tập</li><li>Thưởng các ngày nghỉ Lễ, Tết, lương tháng 13 và các chế độ phúc lợi, chế độ bảo hiểm theo quy định của Nhà nước.</li></ul>YÊU CẦU CHUNG:<br /><ul type=\"disc\"><li>Có khả năng tiếp thu nhanh, sẵn sàng thử nghiệm cái mới.</li><li>Có khả năng đọc hiểu tài liệu tiếng Anh tốt.</li><li>Kỹ năng giao tiếp tự tin và có khả năng truyền đạt dễ hiểu.</li><li>Có hiểu biết về các ngôn ngữ lập trình và các phần mềm thiết kế đồ họa, Photoshop là một lợi thế.</li></ul>Để nắm rõ thông tin công ty và mô tả cụ thể về vị trí cần tuyển, mời bạn tham khảo link dưới đây:<br /><a href=\"http://vmms.vn/chung-toi/chuyen-vien-nhan-da.html\">http://vmms.vn/chung-toi/chuyen-vien-nhan-da.html</a><br />Hải có thể tìm hiểu nhiều hơn về chúng tôi tại website: <a href=\"http://vmms.vn/\">http://vmms.vn/</a><br />Cách thức ứng tuyển:<br />Các bạn quan tâm gửi CV về địa chỉ email: hr@vicoders.com (Tiêu đề ghi rõ Họ tên – Vị trí ứng tuyển)<br />Mọi thắc mắc cần hỗ trợ vui lòng liên hệ:<br />Phòng Hành chính – Nhân sự: 096.392.4242 (liên hệ giờ hành chính)<br />Công ty C<br />Chúng mình rất mong nhận được hồi âm sớm từ Hải!<br />Phòng Hành chính – Nhân sự VMMS</div>\n                                </div>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </center>\n        </div>\n</body></html>', 'template', NULL, NULL, 0, 0, 3, 'en', 'a:0:{}', NULL, 'a:1:{i:0;a:3:{s:9:\"tokenName\";s:17:\"Dynamic Content 1\";s:7:\"content\";s:23:\"Default Dynamic Content\";s:7:\"filters\";a:1:{i:0;a:2:{s:7:\"content\";N;s:7:\"filters\";a:0:{}}}}}', 0, 0);
